import React from 'react';
import Pokemon from './Pokemon';

class Pokedex extends React.Component {
  constructor() {
    super();
    this.state = {
      pokemonNow: 'ola',
    };
  }

//   const prop = this.props.pokemons

  render() {
    return (
      <div className="pokedex">
          <Pokemon key={this.state.pokemonNow.id} pokemon={this.state.pokemonNow[0]} />

      </div>
    );
  }
}

export default Pokedex;
